import Header from 'components/header/header';
import { DrawerProvider } from 'contexts/drawer/drawer.provider';

import React from 'react';

const Blogs = () => {
    return (
        <div>
        <DrawerProvider>
            <Header></Header>
            </DrawerProvider>
            </div>
    )
};

export default Blogs;
